import React, { useEffect } from 'react'; // useEffect eklendi
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import { jwtDecode } from 'jwt-decode'; // Token'ı okumak için
import { socket } from './services/socket'; // Merkezi socket

// KORUYUCULAR
import ProtectedRoute from './components/ProtectedRoute'; 
import AdminProtectedRoute from './components/AdminProtectedRoute'; 

// SAYFALAR
import LoginPage from './pages/LoginPage/LoginPage';
// ... diğer sayfa importlarınız ...
import Dashboard from './pages/Dashboard/Dashboard';
import MessagesPage from './pages/MessagesPage/MessagesPage';


function App() {

  // *** YENİ: Sesli bildirim için genel useEffect
  useEffect(() => {
    const token = localStorage.getItem('token');
    let userRole = null;

    if (token) {
      try {
        userRole = jwtDecode(token).role;
      } catch (error) {
        console.error("Geçersiz token:", error);
      }
    }

    // Sadece admin ise socket'e bağlan ve dinle
    if (userRole === 'admin') {
      socket.connect();

      // Ses dosyasını çalacak fonksiyon
      const playNotificationSound = () => {
        const audio = new Audio('/notification.mp3'); // Ses dosyası public klasöründe olmalı
        audio.play().catch(error => console.log("Ses çalma hatası:", error));
      };

      socket.on('admin_new_message_notification', playNotificationSound);

      // Component temizlendiğinde (örn. çıkış yapıldığında) dinleyiciyi kaldır
      return () => {
        socket.off('admin_new_message_notification', playNotificationSound);
        socket.disconnect();
      };
    }
  }, []); // Bu useEffect sadece bir kere çalışır


  return (
    <Router>
      <Routes>
         =======================================

         <Route path="/" element={<LoginPage />} />
        <Route path="/forgot-password" element={<ForgotPasswordPage />} />


       <Route 
           path="/home" 
           element={<ProtectedRoute><HomePage /></ProtectedRoute>} 
         />


         <Route 
           path="/dashboard" 
           element={<AdminProtectedRoute><Dashboard /></AdminProtectedRoute>} 
         />
         <Route 
           path="/admin/vehicles" 
           element={<AdminProtectedRoute><VehiclesPage /></AdminProtectedRoute>} 
         />
         <Route 
           path="/admin/personnel" 
           element={<AdminProtectedRoute><PersonnelPage /></AdminProtectedRoute>} 
         />
         <Route 
           path="/admin/kredi"
           element={<AdminProtectedRoute><CreditCalculatorPage /></AdminProtectedRoute>} 
         />
         <Route 
           path="/admin/piyasa" 
           element={<AdminProtectedRoute><MarketValuePage /></AdminProtectedRoute>} 
         />
         <Route 
           path="/admin/messages" 
           element={<AdminProtectedRoute><MessagesPage /></AdminProtectedRoute>} 
         />
      </Routes>
    </Router>
  );
}

export default App;
